// SelectService.js

import React, { useState } from 'react';
import ServicesList from './ServiceList';
import services_data from '../../../../beforeLogIn/Services/AllServices'

const SelectService = ({ onNext }) => {
    const [selectedService, setSelectedService] = useState('');

    const handleSelectService = (service) => {
        setSelectedService(service);
    };

    const handleNext = () => {
        onNext({ selectedService });
        // Redirect to the next step/page (e.g., calendar and available hours)
    };

    return (
        <div>
            <h1>Select Service</h1>
            <ServicesList services={services_data} searchTerm="" onSelectService={handleSelectService} />
            <button onClick={handleNext}>Next</button>
        </div>
    );
};

export default SelectService;
